const generateLines = () => {

    const numberOfRows = 10;

    const rows = new Array(numberOfRows);
    rows.forEach(row => {
        row.column = row;
    });

    // return rows;
    return [{}, {}, {}]
};

export default function Game() {
    return (
        <GameBoard word="anagramida" lines={generateLines()} />
    );
}
